import React from 'react';
import './App.css';

import { MDBBtn, MDBContainer } from 'mdb-react-ui-kit';
import Navbar from './components/Navbar';

function App() {
  return (
    <MDBContainer fluid>
      <div className="mainbody">
      <div>
        <Navbar/>
      </div>
      </div>
    </MDBContainer>
  );
}

export default App;
